<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\Master\Tenant\Domain\TenantRef;
use Civi\Lughauth\Features\Access\Master\User\Domain\ValueObject\UserTenantVO;
use Civi\Lughauth\Features\Access\Master\User\Domain\ValueObject\UserNameVO;
use Civi\Lughauth\Features\Access\Master\User\Domain\ValueObject\UserPasswordVO;
use Civi\Lughauth\Features\Access\Master\User\Domain\ValueObject\UserEmailVO;
use Civi\Lughauth\Features\Access\Master\User\Domain\ValueObject\UserWellcomeAtVO;
use Civi\Lughauth\Features\Access\Master\User\Domain\ValueObject\UserEnabledVO;
use Civi\Lughauth\Features\Access\Master\User\Domain\ValueObject\UserApproveVO;
use Civi\Lughauth\Features\Access\Master\User\Domain\UserApproveOptions;
use Civi\Lughauth\Features\Access\Master\User\Domain\ValueObject\UserTemporalPasswordVO;
use Civi\Lughauth\Features\Access\Master\User\Domain\ValueObject\UserUseSecondFactorsVO;
use Civi\Lughauth\Features\Access\Master\User\Domain\ValueObject\UserSecondFactorSeedVO;
use Civi\Lughauth\Features\Access\Master\User\Domain\ValueObject\UserBlockedUntilVO;
use Civi\Lughauth\Features\Access\Master\User\Domain\ValueObject\UserProviderVO;
use Civi\Lughauth\Features\Access\Master\User\Domain\ValueObject\UserVersionVO;
use Civi\Lughauth\Features\Access\Master\User\Application\Usecase\Retrieve\UserRetrieveResult;
use PHPUnit\Framework\TestCase;

final class UserRetrieveResultUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new UserRetrieveResult();
        $tenantOneValue = new TenantRef('one');
        $tenantOtherValue = new TenantRef('other');
        $copy = $value->tenant($tenantOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(new TenantRef('one'), $value->getTenant());
        $this->assertNotEquals(new TenantRef('other'), $value->getTenant());
        $this->assertEquals(new TenantRef('one'), $value->getTenantOrDefault(UserTenantVO::from($tenantOtherValue))->value());
        $this->assertNotEquals(new TenantRef('other'), $value->getTenantOrDefault(UserTenantVO::from($tenantOtherValue))->value());
        $value->unsetTenant();
        $this->assertEquals(new TenantRef('other'), $value->getTenantOrDefault(UserTenantVO::from($tenantOtherValue))->value());
        $this->assertNotEquals(new TenantRef('one'), $value->getTenantOrDefault(UserTenantVO::from($tenantOtherValue))->value());
        $nameOneValue = 'one';
        $nameOtherValue = 'other';
        $copy = $value->name($nameOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getName());
        $this->assertNotEquals('other', $value->getName());
        $this->assertEquals('one', $value->getNameOrDefault(UserNameVO::from($nameOtherValue))->value());
        $this->assertNotEquals('other', $value->getNameOrDefault(UserNameVO::from($nameOtherValue))->value());
        $value->unsetName();
        $this->assertEquals('other', $value->getNameOrDefault(UserNameVO::from($nameOtherValue))->value());
        $this->assertNotEquals('one', $value->getNameOrDefault(UserNameVO::from($nameOtherValue))->value());
        $passwordOneValue = 'cyphered://cypher';
        $passwordOtherValue = 'cyphered://ocyphered';
        $copy = $value->password($passwordOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('cyphered://cypher', $value->getPassword());
        $this->assertNotEquals('cyphered://ocyphered', $value->getPassword());
        $this->assertEquals('****er', $value->getPasswordOrDefault(UserPasswordVO::from($passwordOtherValue))->value());
        $this->assertNotEquals('****ed', $value->getPasswordOrDefault(UserPasswordVO::from($passwordOtherValue))->value());
        $value->unsetPassword();
        $this->assertEquals('****ed', $value->getPasswordOrDefault(UserPasswordVO::from($passwordOtherValue))->value());
        $this->assertNotEquals('****er', $value->getPasswordOrDefault(UserPasswordVO::from($passwordOtherValue))->value());
        $emailOneValue = 'one@fakemail.net';
        $emailOtherValue = 'other@fakemail.net';
        $copy = $value->email($emailOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one@fakemail.net', $value->getEmail());
        $this->assertNotEquals('other@fakemail.net', $value->getEmail());
        $this->assertEquals('one@fakemail.net', $value->getEmailOrDefault(UserEmailVO::from($emailOtherValue))->value());
        $this->assertNotEquals('other@fakemail.net', $value->getEmailOrDefault(UserEmailVO::from($emailOtherValue))->value());
        $value->unsetEmail();
        $this->assertEquals('other@fakemail.net', $value->getEmailOrDefault(UserEmailVO::from($emailOtherValue))->value());
        $this->assertNotEquals('one@fakemail.net', $value->getEmailOrDefault(UserEmailVO::from($emailOtherValue))->value());
        $wellcomeAtOneValue = (new \DateTimeImmutable('1980-08-20T14:32:45.123Z'));
        $wellcomeAtOtherValue = (new \DateTimeImmutable('1981-09-06T14:32:45.123Z'));
        $copy = $value->wellcomeAt($wellcomeAtOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getWellcomeAt());
        $this->assertNotEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getWellcomeAt());
        $this->assertEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getWellcomeAtOrDefault(UserWellcomeAtVO::from($wellcomeAtOtherValue))->value());
        $this->assertNotEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getWellcomeAtOrDefault(UserWellcomeAtVO::from($wellcomeAtOtherValue))->value());
        $value->unsetWellcomeAt();
        $this->assertEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getWellcomeAtOrDefault(UserWellcomeAtVO::from($wellcomeAtOtherValue))->value());
        $this->assertNotEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getWellcomeAtOrDefault(UserWellcomeAtVO::from($wellcomeAtOtherValue))->value());
        $enabledOneValue = true;
        $enabledOtherValue = false;
        $copy = $value->enabled($enabledOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->isEnabled());
        $this->assertNotEquals(false, $value->isEnabled());
        $this->assertEquals(true, $value->getEnabledOrDefault(UserEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(false, $value->getEnabledOrDefault(UserEnabledVO::from($enabledOtherValue))->value());
        $value->unsetEnabled();
        $this->assertEquals(false, $value->getEnabledOrDefault(UserEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(true, $value->getEnabledOrDefault(UserEnabledVO::from($enabledOtherValue))->value());
        $approveOneValue = UserApproveOptions::UNVERIFIED;
        $approveOtherValue = UserApproveOptions::PENDING;
        $copy = $value->approve($approveOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(UserApproveOptions::UNVERIFIED, $value->getApprove());
        $this->assertNotEquals(UserApproveOptions::PENDING, $value->getApprove());
        $this->assertEquals(UserApproveOptions::UNVERIFIED, $value->getApproveOrDefault(UserApproveVO::from($approveOtherValue))->value());
        $this->assertNotEquals(UserApproveOptions::PENDING, $value->getApproveOrDefault(UserApproveVO::from($approveOtherValue))->value());
        $value->unsetApprove();
        $this->assertEquals(UserApproveOptions::PENDING, $value->getApproveOrDefault(UserApproveVO::from($approveOtherValue))->value());
        $this->assertNotEquals(UserApproveOptions::UNVERIFIED, $value->getApproveOrDefault(UserApproveVO::from($approveOtherValue))->value());
        $temporalPasswordOneValue = true;
        $temporalPasswordOtherValue = false;
        $copy = $value->temporalPassword($temporalPasswordOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->isTemporalPassword());
        $this->assertNotEquals(false, $value->isTemporalPassword());
        $this->assertEquals(true, $value->getTemporalPasswordOrDefault(UserTemporalPasswordVO::from($temporalPasswordOtherValue))->value());
        $this->assertNotEquals(false, $value->getTemporalPasswordOrDefault(UserTemporalPasswordVO::from($temporalPasswordOtherValue))->value());
        $value->unsetTemporalPassword();
        $this->assertEquals(false, $value->getTemporalPasswordOrDefault(UserTemporalPasswordVO::from($temporalPasswordOtherValue))->value());
        $this->assertNotEquals(true, $value->getTemporalPasswordOrDefault(UserTemporalPasswordVO::from($temporalPasswordOtherValue))->value());
        $useSecondFactorsOneValue = true;
        $useSecondFactorsOtherValue = false;
        $copy = $value->useSecondFactors($useSecondFactorsOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->isUseSecondFactors());
        $this->assertNotEquals(false, $value->isUseSecondFactors());
        $this->assertEquals(true, $value->getUseSecondFactorsOrDefault(UserUseSecondFactorsVO::from($useSecondFactorsOtherValue))->value());
        $this->assertNotEquals(false, $value->getUseSecondFactorsOrDefault(UserUseSecondFactorsVO::from($useSecondFactorsOtherValue))->value());
        $value->unsetUseSecondFactors();
        $this->assertEquals(false, $value->getUseSecondFactorsOrDefault(UserUseSecondFactorsVO::from($useSecondFactorsOtherValue))->value());
        $this->assertNotEquals(true, $value->getUseSecondFactorsOrDefault(UserUseSecondFactorsVO::from($useSecondFactorsOtherValue))->value());
        $secondFactorSeedOneValue = 'cyphered://cypher';
        $secondFactorSeedOtherValue = 'cyphered://ocyphered';
        $copy = $value->secondFactorSeed($secondFactorSeedOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('cyphered://cypher', $value->getSecondFactorSeed());
        $this->assertNotEquals('cyphered://ocyphered', $value->getSecondFactorSeed());
        $this->assertEquals('****er', $value->getSecondFactorSeedOrDefault(UserSecondFactorSeedVO::from($secondFactorSeedOtherValue))->value());
        $this->assertNotEquals('****ed', $value->getSecondFactorSeedOrDefault(UserSecondFactorSeedVO::from($secondFactorSeedOtherValue))->value());
        $value->unsetSecondFactorSeed();
        $this->assertEquals('****ed', $value->getSecondFactorSeedOrDefault(UserSecondFactorSeedVO::from($secondFactorSeedOtherValue))->value());
        $this->assertNotEquals('****er', $value->getSecondFactorSeedOrDefault(UserSecondFactorSeedVO::from($secondFactorSeedOtherValue))->value());
        $blockedUntilOneValue = (new \DateTimeImmutable('1980-08-20T14:32:45.123Z'));
        $blockedUntilOtherValue = (new \DateTimeImmutable('1981-09-06T14:32:45.123Z'));
        $copy = $value->blockedUntil($blockedUntilOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getBlockedUntil());
        $this->assertNotEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getBlockedUntil());
        $this->assertEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getBlockedUntilOrDefault(UserBlockedUntilVO::from($blockedUntilOtherValue))->value());
        $this->assertNotEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getBlockedUntilOrDefault(UserBlockedUntilVO::from($blockedUntilOtherValue))->value());
        $value->unsetBlockedUntil();
        $this->assertEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getBlockedUntilOrDefault(UserBlockedUntilVO::from($blockedUntilOtherValue))->value());
        $this->assertNotEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getBlockedUntilOrDefault(UserBlockedUntilVO::from($blockedUntilOtherValue))->value());
        $providerOneValue = 'one';
        $providerOtherValue = 'other';
        $copy = $value->provider($providerOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getProvider());
        $this->assertNotEquals('other', $value->getProvider());
        $this->assertEquals('one', $value->getProviderOrDefault(UserProviderVO::from($providerOtherValue))->value());
        $this->assertNotEquals('other', $value->getProviderOrDefault(UserProviderVO::from($providerOtherValue))->value());
        $value->unsetProvider();
        $this->assertEquals('other', $value->getProviderOrDefault(UserProviderVO::from($providerOtherValue))->value());
        $this->assertNotEquals('one', $value->getProviderOrDefault(UserProviderVO::from($providerOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(UserVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(UserVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(UserVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(UserVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
